Site.page.template['angular/misc/recurrentReminder.ng.tmpl'] = '<div \n  class=\"emailverify recurrent-reminder\" \n  ng-show=\"recurrentReminder.isShown\"\n  ng-class=\"{ \n    \'emailverify--password\': recurrentReminder.type === \'password\'\n  }\">\n  <button\n    type=\"button\"\n    class=\"emailverify-close\"\n    ng-click=\"recurrentReminder.close()\"\n    aria-label=\"Close\"\n  >\n    <svg class=\"svgicon\" width=\"16\" height=\"16\"><use xlink:href=\"#flaticon--cross\"/></svg>\n  </button>\n  <div class=\"emailverify-message\">\n    <p class=\"emailverify__text\">{{recurrentReminder.title}}</p>\n    <p\n      ng-show=\"recurrentReminder.type === \'email\'\"\n      class=\"emailverify__text\"\n      lj-ml=\"recurrentreminder.email.message\"\n      lj-ml-resolve=\"{email: \'{{recurrentReminder.messageData}}\'}\"\n    ></p>\n    <p\n      ng-show=\"recurrentReminder.type === \'password\'\"\n      class=\"emailverify__text\"\n      lj-ml=\"recurrentreminder.password.message\"\n      lj-ml-resolve=\"{messageData: \'{{recurrentReminder.messageData}}\'}\"\n    ></p>\n    <div class=\"emailverify__toolbar\">\n      <button\n        data-reconfirm-elem=\"logout\"\n        class=\"emailverify__button lightbutton lightbutton--red\"\n        tabindex=\"50\"\n        ng-click=\"recurrentReminder.leftAction()\"\n      >\n        <svg class=\"svgicon\" width=\"16\" height=\"16\"><use xlink:href=\"#flaticon--cross\"/></svg>\n        <span \n          ng-if=\"recurrentReminder.leftActionLabelShort\"\n          class=\"emailverify__button-text--short\"\n          >{{recurrentReminder.leftActionLabelShort}}</span>\n        <span class=\"emailverify__button-text\">{{recurrentReminder.leftActionLabel}}</span>\n      </button>\n      <button\n        data-reconfirm-elem=\"submit\"\n        class=\"emailverify__button lightbutton lightbutton--blue\"\n        tabindex=\"50\"\n        ng-click=\"recurrentReminder.rightAction()\"\n      >\n        <svg class=\"svgicon\" width=\"16\" height=\"16\"><use xlink:href=\"#flaticon--check\"/></svg>\n        <span \n          ng-if=\"recurrentReminder.rightActionLabelShort\"\n          class=\"emailverify__button-text--short\"\n          >{{recurrentReminder.rightActionLabelShort}}</span>\n        <span class=\"emailverify__button-text\">{{recurrentReminder.rightActionLabel}}</span>\n      </button>\n    </div>\n  </div>\n</div>';
